package edu.lu.oleconvert.ole;

import java.io.Serializable;
import java.text.DateFormat;
import java.text.SimpleDateFormat;
import java.util.Calendar;
import java.util.UUID;

import javax.persistence.*;

import edu.lu.oleconvert.LU_DBLoadInstances;

@Entity
@Table(name="krew_doc_hdr_t")
//@SecondaryTable(name="krew_doc_hdr_cntnt_t", pkJoinColumns={ @PrimaryKeyJoinColumn(name="DOC_HDR_ID") })
public class FDoc implements Serializable {

	/**
	 * 
	 */
	private static final long serialVersionUID = 2741525188860689623L;

	private static DateFormat df = new SimpleDateFormat("yyyyMMdd");
	private static String datestr = df.format(Calendar.getInstance().getTime());
	
	@Id
	@GeneratedValue
	@Column(name="DOC_HDR_ID")
	private Long Id;
	
	@Column(name="OBJ_ID")
	private String objId;
	
	@Column(name="VER_NBR")
	private int versionNumber;
	
	@Column(name="DOC_VER_NBR")
	private int docVersionNumber;
	
	@Column(name="DOC_TYP_ID")
	private String type;
	
	@Column(name="DOC_HDR_STAT_CD")
	private String statCode;
	
	@Column(name="RTE_LVL")
	private int routeLevel;
	
	@Column(name="STAT_MDFN_DT")
	private String statModificationDate;
	
	@Column(name="CRTE_DT")
	private String createDate;
	
	@Column(name="RTE_STAT_MDFN_DT")
	private String routeStatModificationDate;
	
	@Column(name="TTL")
	private String title;
	
	@Column(name="INITR_PRNCPL_ID")
	private String user;
	
	@OneToOne(fetch=FetchType.LAZY, cascade=CascadeType.ALL)
	@PrimaryKeyJoinColumn
	//@JoinColumn(name="DOC_HDR_ID")
	private FDocContent content;

	//@Column(table="krew_doc_hdr_cntnt_t", name="DOC_CNTNT_TXT")
	//private String content;
	
	@OneToOne(fetch=FetchType.LAZY, cascade=CascadeType.ALL)
	@PrimaryKeyJoinColumn
	//@JoinColumn(name="DOC_HDR_ID")
	private KRNSDoc krnsDoc;
	
	public FDoc() {
		super();
		this.versionNumber = 1; 
		this.setObjId(UUID.randomUUID().toString());
	}
	
	public FDoc(SerialsReceiving sr) {
		this();
		// We don't actually use the SerialsReceiving object in here, we just
		// have this constructor to differentiate between when an object is
		// create while creating the entity manager using the default constructor,
		// and when one is actually being built by the loader, which calls this constructor
		/*
		try {
			FDoc doc = (FDoc) LU_DBLoadInstances.ole_em.createNativeQuery("select * from krew_doc_hdr_t where doc_hdr_id=(select max(doc_hdr_id) from krew_doc_hdr_t)", FDoc.class).getSingleResult();
			if ( doc == null ) {
				this.Id = "1";
			} else {
				this.Id = Integer.toString(Integer.parseInt(doc.getId()) + 1);
			}
		} catch (NoResultException e) {
			// table was empty, that's okay
			this.Id = "1";
		}
		*/
		// shouldn't be necessary to manually persist these, should cascade
		//LU_DBLoadInstances.ole_em.persist(this.content);
		//LU_DBLoadInstances.ole_em.persist(this.krnsDoc);
		this.setType("999999"); // Serials receiving type code, drawn from one Sharon create manually
		this.setStatCode("S"); // same
		this.setRouteLevel(0); // same
		this.setStatModificationDate(datestr);
		this.setCreateDate(datestr);
		this.setRouteStatModificationDate(datestr);
		this.setTitle("Record created by serials receiving loader on " + datestr);
		this.setDocVersionNumber(1);
		this.setUser("olequickstart");
		this.content = new FDocContent(this);
		//this.setContent("");
		this.krnsDoc = new KRNSDoc(this);
	}
	public Long getId() {
		return Id;
	}

	public void setId(Long id) {
		Id = id;
	}

	public String getObjId() {
		return objId;
	}

	public void setObjId(String objId) {
		this.objId = objId;
	}

	public int getVersionNumber() {
		return versionNumber;
	}

	public void setVersionNumber(int versionNumber) {
		this.versionNumber = versionNumber;
	}

	public FDocContent getContent() {
		return content;
	}

	public void setContent(FDocContent content) {
		this.content = content;
	}

	public static DateFormat getDf() {
		return df;
	}

	public static void setDf(DateFormat df) {
		FDoc.df = df;
	}

	public static String getDatestr() {
		return datestr;
	}

	public static void setDatestr(String datestr) {
		FDoc.datestr = datestr;
	}

	public int getDocVersionNumber() {
		return docVersionNumber;
	}

	public void setDocVersionNumber(int docVersionNumber) {
		this.docVersionNumber = docVersionNumber;
	}

	public String getType() {
		return type;
	}

	public void setType(String type) {
		this.type = type;
	}

	public String getStatCode() {
		return statCode;
	}

	public void setStatCode(String statCode) {
		this.statCode = statCode;
	}

	public int getRouteLevel() {
		return routeLevel;
	}

	public void setRouteLevel(int routeLevel) {
		this.routeLevel = routeLevel;
	}

	public String getStatModificationDate() {
		return statModificationDate;
	}

	public void setStatModificationDate(String statModificationDate) {
		this.statModificationDate = statModificationDate;
	}

	public String getCreateDate() {
		return createDate;
	}

	public void setCreateDate(String createDate) {
		this.createDate = createDate;
	}

	public String getRouteStatModificationDate() {
		return routeStatModificationDate;
	}

	public void setRouteStatModificationDate(String routeStatModificationDate) {
		this.routeStatModificationDate = routeStatModificationDate;
	}

	public String getTitle() {
		return title;
	}

	public void setTitle(String title) {
		this.title = title;
	}

	public String getUser() {
		return user;
	}

	public void setUser(String user) {
		this.user = user;
	}

	public KRNSDoc getKrnsDoc() {
		return krnsDoc;
	}

	public void setKrnsDoc(KRNSDoc krnsDoc) {
		this.krnsDoc = krnsDoc;
	}
	
	
}
